module.exports = JSON.parse("{\"data\":{\"allMarkdownRemark\":{\"edges\":[{\"node\":{\"id\":\"3debb0a1-5246-54b3-9d6e-9083552de691\",\"html\":\"<blockquote>\\n<p>Stella Wong wields the kind of weaponry I live to be slayed by. Funny as hell, delightfully strange and full of a sneaky and giant heart, American Zero is holds its beloved subjects — friends, siblings, Lucy Liu, grapefruits, all the jesuses the poet can muster — and gives them body with wicked imagination and knock-out tenderness. This book will knock the windows of your heart not just open, but out the frame once you see how far Wong can dive into fear and the terrible possibles of humanness can still carry back something like hope, gooder than joy. Wong has crafted a brief, but mighty collection of poems that point towards the bright possibly of power to make us better dreamers, better lovers, better homies, and oh my jesuses how thankful I am for this abundant offering. I'm sure you will be too.</p>\\n<p>-- <cite>Danez Smith</cite></p>\\n</blockquote>\",\"frontmatter\":{\"author\":\"Danez Smith\",\"image\":{\"childImageSharp\":{\"fluid\":{\"base64\":\"data:image/jpeg;base64,\",\"aspectRatio\":1,\"src\":\"/static/fe055c1c3d103f75588ba6b04cf85f75/a8669/cite_danez_smith.jpg\",\"srcSet\":\"/static/fe055c1c3d103f75588ba6b04cf85f75/15e7a/cite_danez_smith.jpg 125w,\\n/static/fe055c1c3d103f75588ba6b04cf85f75/894b0/cite_danez_smith.jpg 250w,\\n/static/fe055c1c3d103f75588ba6b04cf85f75/a8669/cite_danez_smith.jpg 500w\",\"sizes\":\"(max-width: 500px) 100vw, 500px\"}}}}}},{\"node\":{\"id\":\"1bfb9546-bbdf-529f-8922-88ab5913a28e\",\"html\":\"<blockquote>\\n<p>If poetry were a biathlon, Stella Wong would take the gold. She's a solid skier and a crack shot, each poem a bullet hitting its mark. Thank God she's turned all of this energy and accuracy into poetry. 'Where do you put your body of color' she asks. Then proceeds to school everyone. Stella Wong is a force, a maker, a master.</p>\\n<p>-- <cite>D.A. Powell</cite></p>\\n</blockquote>\",\"frontmatter\":{\"author\":\"D.A. Powell\",\"image\":{\"childImageSharp\":{\"fluid\":{\"base64\":\"data:image/jpeg;base64,\",\"aspectRatio\":1,\"src\":\"/static/6c3e769d437a4721364eb22b57deeb85/ae6ae/cite_da_powell.jpg\",\"srcSet\":\"/static/6c3e769d437a4721364eb22b57deeb85/15e7a/cite_da_powell.jpg 125w,\\n/static/6c3e769d437a4721364eb22b57deeb85/894b0/cite_da_powell.jpg 250w,\\n/static/6c3e769d437a4721364eb22b57deeb85/ae6ae/cite_da_powell.jpg 400w\",\"sizes\":\"(max-width: 400px) 100vw, 400px\"}}}}}},{\"node\":{\"id\":\"e4ad5286-6fb8-5897-8626-6465a2e882fe\",\"html\":\"<blockquote>\\n<p>You and Stella Wong are the last two people on Earth. You’re going to witness her “ride in/to hell” and you will need to prepare yourself for the moment when she decides to use her “daddy voice” on Jesus. You’re the last two people on Earth because the truth—the truth of Stella Wong’s voice, the truth of these poems—has scared away the timid. But be strong. The apocalypse of American Zero is scary and dangerous, yes, but it’s also a lot of fun.</p>\\n<p>-- <cite>Josh Bell</cite></p>\\n</blockquote>\",\"frontmatter\":{\"author\":\"Josh Bell\",\"image\":{\"childImageSharp\":{\"fluid\":{\"base64\":\"data:image/jpeg;base64,\",\"aspectRatio\":1,\"src\":\"/static/c0ec4ca11d150ff28d86eddf24b36ed9/573ce/cite_josh_bell.jpg\",\"srcSet\":\"/static/c0ec4ca11d150ff28d86eddf24b36ed9/15e7a/cite_josh_bell.jpg 125w,\\n/static/c0ec4ca11d150ff28d86eddf24b36ed9/573ce/cite_josh_bell.jpg 220w\",\"sizes\":\"(max-width: 220px) 100vw, 220px\"}}}}}},{\"node\":{\"id\":\"9f539c8e-f51b-5744-b2ed-a813667beebc\",\"html\":\"<blockquote>\\n<p>Bookended by dramatic appeals to Lucy Liu and America itself, another name for Stella Wong's exciting, candid, incantatory American Zero might be 'American Presence,' for Wong's is a crisp new voice intently, intensely, undeniably zeroing in, and it's certainly not for nothing that the important last word of the important last poem is 'here.'</p>\\n<p>-- <cite>Robyn Schiff</cite></p>\\n</blockquote>\",\"frontmatter\":{\"author\":\"Robyn Schiff\",\"image\":{\"childImageSharp\":{\"fluid\":{\"base64\":\"data:image/jpeg;base64,\",\"aspectRatio\":1,\"src\":\"/static/7e1d9ec3fc4042170952050d0c5c2a4a/a8669/cite_robyn_schiff.jpg\",\"srcSet\":\"/static/7e1d9ec3fc4042170952050d0c5c2a4a/15e7a/cite_robyn_schiff.jpg 125w,\\n/static/7e1d9ec3fc4042170952050d0c5c2a4a/894b0/cite_robyn_schiff.jpg 250w,\\n/static/7e1d9ec3fc4042170952050d0c5c2a4a/a8669/cite_robyn_schiff.jpg 500w\",\"sizes\":\"(max-width: 500px) 100vw, 500px\"}}}}}}]}}}");

