module.exports = JSON.parse("{\"data\":{\"allMarkdownRemark\":{\"edges\":[{\"node\":{\"id\":\"5dcea183-0561-5af0-8e18-6af21616b450\",\"html\":\"<blockquote>\\n<p>Stella Wong wields the kind of weaponry I live to be slayed by. Funny as hell, delightfully strange and full of a sneaky and giant heart, holds its beloved subjects — friends, siblings, Lucy Liu, grapefruits, all the jesuses the poet can muster — and gives them body with wicked imagination and knock-out tenderness. This book will knock the windows of your heart not just open, but out the frame once you see how far Wong can dive into fear and the terrible possibles of humanness can still carry back something like hope, gooder than joy. Wong has crafted a brief, but mighty collection of poems that point towards the bright possibly of power to make us better dreamers, better lovers, better homies, and oh my jesuses how thankful I am for this abundant offering. I'm sure you will be too.</p>\\n<p>-- <cite>Danez Smith</cite></p>\\n</blockquote>\\n<blockquote>\\n<p>If poetry were a biathlon, Stella Wong would take the gold. She's a solid skier and a crack shot, each poem a bullet hitting its mark. Thank God she's turned all of this energy and accuracy into poetry. 'Where do you put your body of color' she asks. Then proceeds to school everyone. Stella Wong is a force, a maker, a master.</p>\\n<p>-- <cite>D.A. Powell</cite></p>\\n</blockquote>\\n<blockquote>\\n<p>Spooks is an inquiring of rhythms. Its poems think in rhythms derived from many cultural sources, but most often from hip-hop as filtered through everyday speech—but not only rhythms derived from music, but also rhythms derived from the motions of culture both at the center and the periphery of Stella Wong's attention. While foregrounding various rhythms, the poems in Spooks defy those sources thereof that are rooted in patriarchy and other forms of oppression—these poems ask what new songs can be made of a tainted music, even while being such songs.</p>\\n<p>-- <cite>Shane McCrae</cite></p>\\n</blockquote>\\n<blockquote>\\n<p>Reading SPOOKS is the most fun I’ve had since dandelion-ing at a fetish party. The titles are brilliant. The speakers of the poems are secret agents, search engineers and dissociative fugues. The poems are elastic with tones that range from hilarious deadpan one-liners to astonishing tenderness. ‘Oh, love is at // no cost to you’ reads one poem and I’m like ‘yr gonna make me cry right after you made me laugh.’ If Catullus were around, he’d be so proud.</p>\\n<p>-- <cite>Cy Jillian Weise</cite></p>\\n</blockquote>\\n<blockquote>\\n<p>Spooks is, among other things, a generous and richly populated book. The poems are both challenging and welcoming, filled with as many entrances and exits, as much warmth as honest, as much risk as playfulness. This is a beautiful book of enduring images, and masterful storytelling.</p>\\n<p>-- <cite>Hanif Abdurraqib</cite></p>\\n</blockquote>\\n<blockquote>\\n<p>You and Stella Wong are the last two people on Earth. You’re going to witness her “ride in/to hell” and you will need to prepare yourself for the moment when she decides to use her “daddy voice” on Jesus. You’re the last two people on Earth because the truth—the truth of Stella Wong’s voice, the truth of these poems—has scared away the timid. But be strong. The apocalypse of American Zero is scary and dangerous, yes, but it’s also a lot of fun.</p>\\n<p>-- <cite>Josh Bell</cite></p>\\n</blockquote>\",\"frontmatter\":{\"title\":\"Spooks\",\"image\":{\"childImageSharp\":{\"fluid\":{\"aspectRatio\":0.7331378299120235,\"src\":\"/static/5d76d3edab17a57920a6fa8399953caa/eeda9/spooks-cover.jpg\",\"srcSet\":\"/static/5d76d3edab17a57920a6fa8399953caa/0f3a1/spooks-cover.jpg 500w,\\n/static/5d76d3edab17a57920a6fa8399953caa/a7715/spooks-cover.jpg 1000w,\\n/static/5d76d3edab17a57920a6fa8399953caa/eeda9/spooks-cover.jpg 1650w\",\"sizes\":\"(max-width: 1650px) 100vw, 1650px\"}}}}}}]}}}");

